INSERT INTO `tb_pagina` (`idpage`, `titulo`, `contenido`, `portada`, `datecreated`, `ruta`, `estado`) VALUES
(1, 'Inicio', '&lt;div id=&quot;banner&quot; class=&quot;banner full-screen-mode parallax&quot;&gt;&lt;div class=&quot;container pr&quot;&gt;&lt;div class=&quot;col-lg-12 col-md-12 col-sm-12 col-xs-12&quot;&gt;&lt;div class=&quot;banner-static&quot;&gt;&lt;div class=&quot;banner-text&quot;&gt;&lt;div class=&quot;banner-cell&quot;&gt;&lt;h1&gt;&lt;span class=&quot;typer&quot; id=&quot;some-id&quot; data-delay=&quot;200&quot; data-delim=&quot;:&quot; data-words=&quot;La Felicidad llego a tu casa&quot; data-colors=&quot;red&quot;&gt;&lt;/span&gt;&lt;/h1&gt;&lt;p&gt;&lt;br data-mce-bogus=&quot;1&quot;&gt;&lt;/p&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;&lt;/div&gt;', '', '2024-08-12 09:28:19', 'home', 'A'),
(2, 'Nosotros', '   <section class=\"bg0 p-t-75 p-b-120\">\r\n		<div class=\"container\">\r\n			<div class=\"row p-b-80\">\r\n				<div class=\"col-md-7 col-lg-8\">\r\n					<div class=\"p-t-7 p-r-85 p-r-15-lg p-r-0-md\">\r\n						<h3 class=\"mtext-111 cl2 p-b-16\">\r\n							MISIÓN\r\n						</h3>\r\n\r\n						<p class=\"stext-113 cl6 p-b-26\">\r\n							Sorprender a nuestros clientes con productos de alt&iacute;sima calidad por su elaboraci&oacute;n y dise&ntilde;o, generando en ellos fidelizaci&oacute;n con nuestra marca.\r\n						</p>\r\n                        <h3 class=\"mtext-111 cl2 p-b-16\">\r\n							VISIÓN\r\n						</h3>\r\n                        <p class=\"stext-113 c16 p-b-26\">\r\n                            Al 2030, Tortaza ser&aacute; una marca reconocida por brindar productos de alt&iacute;sima calidad, trato muy amable y agradable ambiente de trabajo.\r\n                        </p>\r\n						\r\n					</div>\r\n				</div>\r\n\r\n				<div class=\"col-11 col-md-5 col-lg-4 m-lr-auto\">\r\n					<div class=\"how-bor1 \">\r\n						<div class=\"hov-img0\">\r\n							<img src=\"Assets/images/about-main.jpg\" alt=\"IMG\">\r\n						</div>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			\r\n			<div class=\"row\">\r\n				<div class=\"order-md-12 col-md-7 col-lg-12\">\r\n					<div class=\"txt-center\">\r\n						<h3 class=\"ltext-105\">\r\n							NUESTRO EQUIPO\r\n						</h3>\r\n						<p class=\"stext-113 cl6 p-t-20 p-b-30\">\r\n							Tenemos todos los protocolos de Salud.\r\n						</p>\r\n					</div>\r\n				</div>\r\n            </div>\r\n            <div class=\"order-md-1 m-lr-auto\">\r\n                <div class=\"how-bor2\">\r\n                    <div class=\"hov-img0\">\r\n                        <img src=\" Assets/images/porta_person.jpg\" alt=\"IMG\">\r\n                    </div>\r\n                </div>\r\n            </div>\r\n			\r\n		</div>\r\n	</section>	', '', '2024-08-12 11:40:29', 'nosotros', 'A'),
(3, 'Equipo', '<div class=\"special-menu pad-top-100 parallax\">\n<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12\">\n<div class=\"wow fadeIn\" data-wow-duration=\"1s\" data-wow-delay=\"0.1s\">\n<h2 class=\"block-title color-white text-center\">Nuestras Variedades</h2>\n<h5 class=\"title-caption text-center\">Más de 30 sabores únicos</h5>\n</div>\n<div class=\"special-box\">\n<div id=\"owl-demo\">\n<div class=\"item item-type-zoom\"><a class=\"item-hover\" href=\"#\">\n<div class=\"item-info\">\n<div class=\"headline\">TORTAS TEMATIZADASa\n<div class=\"line\"> </div>\n<div class=\"dit-line\">Realizamos tortas para todo tipo de eventos.</div>\n</div>\n</div>\n</a>\n<div class=\"item-img\"><img src=\"Assets/images/special-menu-1.jpg\" alt=\"sp-menu\"></div>\n</div>\n<div class=\"item item-type-zoom\"><a class=\"item-hover\" href=\"#\">\n<div class=\"item-info\">\n<div class=\"headline\">CHESSECAKE\n<div class=\"line\"> </div>\n<div class=\"dit-line\">Cheesecake de Fresa, cheesecake de Maracuyá y Cheesecake de Sauco.</div>\n</div>\n</div>\n</a>\n<div class=\"item-img\"><img src=\"Assets/images/special-menu-2.jpg\" alt=\"sp-menu\"></div>\n</div>\n<div class=\"item item-type-zoom\"><a class=\"item-hover\" href=\"#\">\n<div class=\"item-info\">\n<div class=\"headline\">TORTA DE LINEA\n<div class=\"line\"> </div>\n<div class=\"dit-line\">Brindamos la mejor torta.</div>\n</div>\n</div>\n</a>\n<div class=\"item-img\"><img src=\"Assets/images/special-menu-3.jpg\" alt=\"sp-menu\"></div>\n</div>\n<div class=\"item item-type-zoom\"><a class=\"item-hover\" href=\"#\">\n<div class=\"item-info\">\n<div class=\"headline\">TORTAS PERSONALIZADAS\n<div class=\"line\"> </div>\n<div class=\"dit-line\">Realizamos tortas para todo tipo de eventos.</div>\n</div>\n</div>\n</a>\n<div class=\"item-img\"><img src=\"Assets/images/special-menu-1.jpg\" alt=\"sp-menu\"></div>\n</div>\n<div class=\"item item-type-zoom\"><a class=\"item-hover\" href=\"#\">\n<div class=\"item-info\">\n<div class=\"headline\">CHEESECAKE\n<div class=\"line\"> </div>\n<div class=\"dit-line\">Cheesecake de Fresa, cheesecake de Maracuyá y Cheesecake de Sauco.</div>\n</div>\n</div>\n</a>\n<div class=\"item-img\"><img src=\"Assets/images/special-menu.png\" alt=\"sp-menu\"></div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', '', '2024-08-12 11:59:14', 'equipo', 'X'),
(4, 'Catalogo', '<div id=\"catalogo\" class=\"gallery-main pad-top-100 pad-bottom-100\"> <div class=\"container\"> <div class=\"row\"> <div class=\"col-lg-12 col-md-12 col-sm-12 col-xs-12\"> <div class=\"wow fadeIn\" data-wow-duration=\"1s\" data-wow-delay=\"0.1s\"> <h2 class=\"block-title text-center\">Catalogo</h2> </div> <div class=\"gal-container clearfix\"> <div class=\"col-md-4 col-sm-6 co-xs-12 gal-item\"> <div class=\"box\"><a href=\"#\" data-toggle=\"modal\" data-target=\"#1\"> <img src=\"Assets/images/gallery_01.webp\" alt=\"\" /> </a> <div id=\"1\" class=\"modal fade\" tabindex=\"-1\" role=\"dialog\"> <div class=\"modal-dialog\" role=\"document\"> <div class=\"modal-content\"><button class=\"close\" type=\"button\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">&times;</span></button> <div class=\"modal-body\"><img src=\"Assets/images/gallery_01.webp\" alt=\"\" /></div> <div class=\"col-md-12 description\"> <h4>Torta Chocolate</h4> </div> </div> </div> </div> </div> </div> <div class=\"col-md-4 col-sm-6 co-xs-12 gal-item\"> <div class=\"box\"><a href=\"#\" data-toggle=\"modal\" data-target=\"#2\"> <img src=\"Assets/images/gallery_02.webp\" alt=\"\" /> </a> <div id=\"2\" class=\"modal fade\" tabindex=\"-1\" role=\"dialog\"> <div class=\"modal-dialog\" role=\"document\"> <div class=\"modal-content\"><button class=\"close\" type=\"button\" data-dismiss=\"modal\" aria-label=\"Close\"><span aria-hidden=\"true\">&times;</span></button> <div class=\"modal-body\"><img src=\"Assets/images/gallery_02.webp\" alt=\"\" /></div> <div class=\"col-md-12 description\"> <h4>Torta de 3 Leches de Vainilla</h4> </div> </div> </div> </div> </div> </div> <div class=\"col-md-4 col-sm-6 co-xs-12 gal-item\"> <div class=\"box\"><a href=\"#\" data-toggle=\"modal\" data-target=\"#3\"> <img src=\"Assets/images/gallery_03.webp\" alt=\"\" /> </a> <div id=\"3\" class=\"modal fade\" tabindex=\"-1\" role=\"dialog\"> <div class=\"modal-dialog\" role=\"document\"> <di