INSERT INTO `tb_producto_texto` (`idpt`, `nombreproducto`, `descripcion`, `prodenlace`, `prodimagen`, `numporcion`, `estadopt`) VALUES
(1, 'FRESA CON DURAZNO', 'Keke de vainilla con pulpa de fresa,durazno y una capa de manjar fino, bañado con crema chantilly,decorado con cereza, trozos de durazno y kekillo mixto.', 'fdk.html', 'vitrina/fdk.webp', 60, 'A'),
(2, 'COCKTEL DE FRUTAS', 'Keke de vainilla con relleno de manjar en la primera capa y en la segunda capa con frutas (uva, pera, durazno y cereza bañado en chantilly, empastado con mil hojas.', 'coctel-fr.html', 'vitrina/cock.webp', 60, 'A'),
(3, 'SELVA NEGRA', 'Keke de chocolate relleno de pulpa de fresa, durazno y una capa de fudge fino, bañado con crema chantilly, decorado con cereza y ralladura de chocolate.', 'selvanegra.html', 'vitrina/selvanegra.webp', 60, 'A'),
(4, 'SELVA BLANCA', 'Keke de vainilla relleno con pulpa de fresa,durazno y una capa de fudge fino, bañado con crema chantilly,decorado con cereza y ralladura de cobertura blanca.', 'selvablanca.html', 'vitrina/selvablanca.webp', 60, 'A'),
(5, 'TRES LECHES DE VAINILLA', 'Bizcuit de vainilla humedecido de dulcerío de tres leches con \r\nuna capa de mousse de vainilla, bañado con crema \r\nchantilly, polveado de canela.', 'tresleches.html', 'vitrina/tresleches.webp', 60, 'A'),
(6, 'CAPUCCINO', 'Keke de chocolate, humedecido con el dulcerío de tres leches de cafe,bañado con chantilly de café decorado con una rejilla de chocolate.', 'capuccino.html', 'vitrina/capuccino.webp', 60, 'A'),
(7, 'GUANABANA', 'Keke de vainilla con pulpa de guanábana y una capa \r\nde manjar fino, bañado con chantilly de guanabana, \r\ndecorado con cereza y trozos de suspiros.', 'guanabana.html', 'vitrina/guanabana.webp', 60, 'A'),
(8, 'SAUCO', 'Keke de chocolate con mouse de sauco y una capa \r\nde manjar fino, bañado con crema chantilly, decorado \r\ncon cereza y fruti de sauco y kekillo choco.', 'sauco.html', 'vitrina/sauco.webp', 60, 'A'),
(9, 'LUCUMA', 'Keke de chocolate con pulpa de lúcuma y una capa de fudge fino, bañado con crema de lúcuma, decorado con cereza y kekillo choco.', 'lucuma.html', 'vitrina/lucuma.webp', 60, 'A'),
(10, 'CHOCOLATE', 'Keke de chocolate, relleno de mousse de chocolate y fudge fino, bañado con crema de chocolate decorado con cereza y ralladura de chocolate.', 'chocolate.html', 'vitrina/chocolate.webp', 60, 'A'),
(11, 'CHOCOFE', 'Keke de chocolate humedecido con mousse de café y una capa de fudge fino, bañado con chantilly de chocolate, decorado con cereza, jalea de chocolate y filigrama.', 'chocofe.html', 'vitrina/chocofe.webp', 60, 'A'),
(12, 'TENTACION DE MANGO', 'Bizcochuelo de vainilla humedecido  de dulcerio de tres leches de mango, con mousse de mango y chantilly decorado con cereza filigrama y fudge', 'tentacionmango.html', 'vitrina/tentacionmango.webp', 60, 'A'),
(13, 'CANDY-CH', 'Keke de chocolate, relleno de mousse de chocolate y bañado con fudge, decorado con doña pepa.', 'candych.html', 'vitrina/candy.webp', 60, 'A'),
(14, 'TORTA HELADA', 'Gelatina de fresa con mouse de fresa y \r\ndiscos de chocolate con almibar especial, \r\ndecorado con chantilly y filigrama.', 'tortahelada.html', 'vitrina/tortahelada.webp', 60, 'A'),
(15, 'RED VELVET', 'Keke de Red Velvet relleno con doble capa de mouse choco white, bañado con crema chantilly, decorado con cereza y kekillo rojo.', 'redvelvet.html', 'vitrina/red-velvet.webp', 60, 'A'),
(16, 'MANJAR', 'Keke de vainilla con relleno de manjar fino y chantilly, humedecido con almibar especial de la casa, decorado con chantilly cerezas y filigrama.', 'manjar.html', 'vitrina/manjar.webp', 60, 'A'),
(17, 'COCO', 'keke de vainilla humedecido con dulce de coco, relleno de crema de coco, bañado de chantilly empastado con cocada.', 'coco.html', 'vitrina/coco.webp', 60, 'A'),
(18, 'MARACUYA', 'Keke de vainilla con dos capas de mousse de maracuya y una capa de manjar fino, bañado con chantilly de maracuya.', 'maracuya.html', 'vitrina/maracuya.webp', 60, 'A'),
(19, 'SENSACION MARACUYA', 'Bizcuit de vainilla humedecido de dulcerío de tres leches con maracuya, decorado con jalea de maracuya, rejilla de chocolate y cereza.', 'sensacionmaracuya.html', 'vitrina/sensacionmaracuya.webp', 60, 'A'),
(20, 'MOKA', 'Keke de chocolate humedecido con mousse de café y una capa de fudge fino, bañado con chantilly de moka, decorado con cereza, jalea y kekillo de chocolate.', 'moka.html', 'vitrina/moka.webp', 60, 'A'),
(21, 'CHOCOMILK', 'keke de chocolate, humedecido con tres leches de chocolate relleno con crema de chocolate y bañado con chantilly de chocolate.', 'chocomilk.html', 'vitrina/chocomilk.webp', 60, 'A'),
(22, 'CHOCOFRESA', 'Keke de chocolate con pulpa de durazno y una capa de manjar fino, bañado con crema \r\n chantilly, decorado jalea de fresa y con cereza.', 'chocofresa.html', 'vitrina/chocofresa.webp', 60, 'A'),
(23, 'VANIFRESA', 'Keke de vainilla con pulpa de durazno y una capa de manjar fino, bañado con crema \r\n chantilly, decorado jalea de fresa y con cereza.', 'vanifresa.html', 'vitrina/vanifresa.webp', 60, 'A'),
(24, 'DULZURA DE LUCUMA', 'Keke de chocolate humedecido con dulcerío de las tres leches con una capa de mouse de lúcuma y manjar fino, bañado con crema chantilly de lúcuma, polveado de canela.', 'dulzuralucuma.html', 'vitrina/dulzuralucuma.webp', 60, 'A'),
(25, 'CHOCO-MENTA', 'Keke de chocolate con almibar de menta, decorado con crema chantilly, flocos de dulce, cereza y filigrama.', 'mentadurazno.html', 'vitrina/mentadurazno.webp', 60, 'A'),
