CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `procesarVentaContrato` (IN `inumero` INT, IN `icodclient` INT, IN `icod_tienda` INT, IN `snumdoc` VARCHAR(50), IN `dtotal` DECIMAL(18,2), IN `defectivo` DECIMAL(18,2), IN `dvisa` DECIMAL(18,2), IN `dmovil` DECIMAL(18,2), IN `ddescuen` DECIMAL(18,2), IN `dsaldo` DECIMAL(18,2), IN `icod_usu` INT, `sfecha` VARCHAR(20))   BEGIN
	DECLARE icodgen int;
	IF inumero > 0 THEN
    	SET icodgen = inumero;
    	BEGIN
            IF dsaldo > 0 THEN
                UPDATE tb_agreement SET saldo = dsaldo WHERE numero=inumero AND codtnd=icod_tienda;
            ELSE
                UPDATE tb_agreement SET saldo = dsaldo, estadop = 'C' WHERE numero=inumero AND codtnd=icod_tienda;
            END IF;
                        VALUES (inumero, icod_tienda, defectivo, dvisa, dmovil, ddescuen, icod_usu, sfecha);
        END;
    ELSE
    	BEGIN
            SELECT numero INTO icodgen FROM tb_generar_codigo WHERE codtnd=icod_tienda AND operacion='C';
            SET icodgen = icodgen+1;
            IF dsaldo > 0 THEN
                                    VALUES (icodgen, icodclient, icod_tienda, snumdoc, dtotal, dsaldo, icod_usu,sfecha);
            ELSE
                                    VALUES (icodgen, icodclient, icod_tienda, snumdoc, dtotal, dsaldo,'C', icod_usu,sfecha);
            END IF;
                                VALUES (icodgen, icod_tienda, defectivo, dvisa, dmovil, ddescuen, icod_usu,sfecha);
            UPDATE tb_generar_codigo SET numero=icodgen WHERE codtnd=icod_tienda and operacion='C';
        END;
    END IF;
    SELECT * FROM tb_agreement WHERE numero=icodgen AND codtnd=icod_tienda AND numdoc=snumdoc;
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `procesar_entrega` (`icodtienda` INT, `inumero` INT, `icodusu` INT, `sfecha` VARCHAR(20))   BEGIN	
	DECLARE registros int;    
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    DECLARE tbl_tmp_pago VARCHAR(20);
    	SET a = 1;
        SET tbl_tmp_pago = CONCAT("tbl_tmp_pago", icodtienda); 
        DROP TABLE IF EXISTS tbl_tmp_pago;
        CREATE TEMPORARY TABLE tbl_tmp_pago(id int not null AUTO_INCREMENT PRIMARY KEY,cod_prod int, cant_prod int);
        SET registros = (SELECT COUNT(*) FROM tb_sale_detail WHERE numero = inumero AND codtnd = icodtienda);
        IF registros > 0 THEN
        	BEGIN
                WHILE a<=registros DO
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto, tmp_cant_producto FROM tbl_tmp_pago WHERE id = a;
                    SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET nueva_existencia = existencia_actual - tmp_cant_producto;
                    UPDATE tb_stock set stock = nueva_existencia WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET a=a+1;
                END WHILE;           
                TRUNCATE TABLE tbl_tmp_pago;
                UPDATE tb_sale SET estado='A' WHERE numero=inumero AND codtnd=icodtienda;                
   				SELECT 1 estado;
            END;
        ELSE
        	BEGIN
            	SELECT 0 estado;
            END;
        END IF; 
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `procesar_pago` (`itiposale` INT, `icodtienda` INT, `inumero` INT, `itipopag` INT, `dmonto` DECIMAL(18,2), `snumopera` VARCHAR(20), `icodusu` INT, `sfecha` VARCHAR(20))   BEGIN	
	DECLARE registros int;    
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    DECLARE ipago INT;
    DECLARE ptotal DECIMAL(10,2);
    DECLARE ppago DECIMAL(10,2);
    SET a = 1;
    SELECT SUM((precio*cantidad)-ddescu) INTO ptotal FROM tb_sale_detail WHERE numero=inumero AND codtnd=icodtienda;    
            VALUES (icodtienda,inumero,itipopag,dmonto,snumopera,sfecha,icodusu);
	SET ipago = LAST_INSERT_ID();    
    SELECT SUM(montopay) INTO ppago FROM tb_sale_pay WHERE codtienda=icodtienda AND numero=inumero;
    IF ptotal = ppago THEN
    	IF itiposale = 2 THEN        
            DROP TABLE IF EXISTS tbl_tmp_pago;
            CREATE TEMPORARY TABLE tbl_tmp_pago(id int not null AUTO_INCREMENT PRIMARY KEY,cod_prod int, cant_prod int);
            SET registros = (SELECT COUNT(*) FROM tb_sale_detail WHERE numero = inumero AND codtnd = icodtienda);
            IF registros > 0 THEN
                WHILE a<=registros DO
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto, tmp_cant_producto FROM tbl_tmp_pago WHERE id = a;
                    SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET nueva_existencia = existencia_actual - tmp_cant_producto;
                    UPDATE tb_stock set stock = nueva_existencia WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET a=a+1;
                END WHILE;           
                TRUNCATE TABLE tbl_tmp_pago;
            END IF; 
    	END IF;
        UPDATE tb_sale SET estado='A' WHERE numero=inumero AND codtnd=icodtienda;
    END IF;
    SELECT ipago codpago,(ptotal - ppago) saldo;
END$$

