CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `procesar_venta` (`icodtienda` INT, `icodusuario` INT, `observ` VARCHAR(100), `stoken` VARCHAR(50), `icodcliente` INT, `sfecha` VARCHAR(20), `stipo` INT, `sestado` VARCHAR(1), `fdelivery` DECIMAL(10,2))   BEGIN	
