CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `procesar_venta_pago` (`cod_tienda` INT, `cod_usuario` INT, `efectivo` DECIMAL(18,2), `visa` DECIMAL(18,2), `movil` DECIMAL(18,2), `observ` VARCHAR(100), `token` VARCHAR(50), `icliente` INT, `sestado` VARCHAR(1), `sfecha` VARCHAR(20))   BEGIN	
	DECLARE codventa int;
	DECLARE venta int;
    DECLARE registros int;
    DECLARE totalv decimal(10,2);
    DECLARE totaldesc decimal(10,2);
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    SET a = 1;    
    DROP TABLE IF EXISTS tbl_tmp_tokenuser;
    CREATE TEMPORARY TABLE tbl_tmp_tokenuser(id int not null AUTO_INCREMENT PRIMARY KEY,cod_prod int, cant_prod int);
    SET registros = (SELECT COUNT(*) FROM tb_sale_detalle_temp WHERE token_user = token AND codtienda = cod_tienda);
    IF registros > 0 THEN
       	SELECT numero INTO codventa FROM tb_generar_codigo WHERE codtnd=cod_tienda AND operacion='V';
        SET codventa=codventa+1;
        SET venta = LAST_INSERT_ID();
       IF sestado = 'A' THEN
           WHILE a<=registros DO
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto, tmp_cant_producto FROM tbl_tmp_tokenuser WHERE id = a;
                    SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda=cod_tienda and codprod=tmp_cod_producto;
                    SET nueva_existencia = existencia_actual - tmp_cant_producto;
                    UPDATE tb_stock set stock = nueva_existencia WHERE codtienda=cod_tienda and codprod=tmp_cod_producto;
                    SET a=a+1;
