CREATE DEFINER=`desarrollo`@`%` PROCEDURE `spdw_anular_venta` (`itienda` INT, `no_venta` INT, `iusuario` INT, `sfecha` VARCHAR(20))   BEGIN
	DECLARE itiposale int;
    DECLARE sestado VARCHAR(1);
	DECLARE existe_venta int;
    DECLARE registros int;
    DECLARE a int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE existencia_actual int;
    DECLARE nueva_existencia int;
    SET existe_venta = (SELECT COUNT(*) FROM tb_sale WHERE codtnd=itienda AND numero=no_venta AND estado <> 'X');
    IF(existe_venta > 0) THEN
    	SELECT codtiposale,estado INTO itiposale,sestado FROM tb_sale WHERE codtnd = itienda AND numero = no_venta;
        IF sestado = 'A' THEN
        	SET a = 0;
            SET registros = (SELECT COUNT(*) FROM tb_sale_detail WHERE codtnd = itienda AND numero = no_venta);
            WHILE (a < registros) DO
                SELECT codprod,cantidad INTO tmp_cod_producto,tmp_cant_producto FROM tb_sale_detail WHERE codtnd = itienda AND numero = no_venta LIMIT a,1;
                SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda = itienda AND codprod = tmp_cod_producto;
                SET nueva_existencia = existencia_actual + tmp_cant_producto;
                UPDATE tb_stock SET stock = nueva_existencia WHERE codtienda = itienda AND codprod = tmp_cod_producto;                
                SET a = a + 1;
           	END WHILE;           
        END IF;
        UPDATE tb_sale_pay SET estado = 'X' WHERE codtienda = itienda AND numero = no_venta;
    	UPDATE tb_sale SET estado = 'X', codusupd = iusuario, f_aud = sfecha WHERE codtnd = itienda AND numero = no_venta;          
        SELECT 1 venta;       
    ELSE
    	SELECT 0 venta;
    END IF;    
END$$

