CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_checkin_porcion` (`itienda` INT, `imodulo` INT, `iretito` INT, `idetalle` INT, `iproducto` INT, `icantidad` INT, `sfecha` VARCHAR(20), `iusuario` INT)   BEGIN
        DECLARE nueva_cantidad int;
        DECLARE actual_cantidad int;        
        IF EXISTS (SELECT * FROM tb_stock_detaret WHERE codretiro = iretito AND codetalle = idetalle AND estado = 'A') THEN
			SELECT stock INTO actual_cantidad FROM tb_stock WHERE codtienda = itienda AND codprod = iproducto;
			SET nueva_cantidad = (actual_cantidad + icantidad);
			UPDATE tb_stock SET stock = nueva_cantidad WHERE codtienda = itienda AND codprod = iproducto;
			UPDATE tb_stock_detaret SET estado = 'P', fechaupd = sfecha, codusupd = iusuario  WHERE codretiro = iretito AND codetalle = idetalle AND estado = 'A';
			SELECT nueva_cantidad cantidad;
        ELSE
			SELECT 0 cantidad;
        END IF;       
    END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_checkin_traslado` (`inumero` INT, `itienda` INT, `iusuario` INT, `sfecha` VARCHAR(20))   BEGIN
    DECLARE registros int;    
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    SET a = 0;    
    SET registros = (SELECT COUNT(*) FROM tb_stock_detaret WHERE codretiro = inumero);
    IF registros > 0 THEN
        WHILE a < registros DO
            SELECT codproducto,cantidad INTO tmp_cod_producto, tmp_cant_producto FROM tb_stock_detaret WHERE codretiro = inumero LIMIT a,1;
            SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda=itienda and codprod=tmp_cod_producto;
            SET nueva_existencia = existencia_actual + tmp_cant_producto;
            UPDATE tb_stock set stock = nueva_existencia WHERE codtienda=itienda and codprod=tmp_cod_producto;
            SET a = a + 1;
        END WHILE;
        UPDATE tb_stock_retiro SET estado = 'P',fechaupd = sfecha, codusupd = iusuario WHERE codigo = inumero;
        SELECT 1 result;
    ELSE
    	SELECT 0 result;
    END IF;
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_checkout_retiro` (`stoken` VARCHAR(100), `itienda` INT, `icodtipo` INT, `icodestino` INT, `sobservacion` VARCHAR(100), `iusuario` INT, `sfecha` VARCHAR(20))   BEGIN
	DECLARE retiroid int;
    DECLARE registros int;    
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    SET a = 0;
    SET registros = (SELECT COUNT(*) FROM tb_stock_detaret_temp WHERE token = stoken AND codtienda = itienda);
    IF registros > 0 THEN
        SET retiroid = LAST_INSERT_ID();
        WHILE a < registros DO
        	SELECT codproducto,cantidad INTO tmp_cod_producto, tmp_cant_producto FROM tb_stock_detaret_temp WHERE token = stoken AND codtienda = itienda LIMIT a,1;
            SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda = itienda and codprod = tmp_cod_producto;
            SET nueva_existencia = existencia_actual - tmp_cant_producto;
            UPDATE tb_stock set stock = nueva_existencia WHERE codtienda = itienda and codprod = tmp_cod_producto;            
            SET a = a + 1;
        END WHILE;
		DELETE FROM tb_stock_detaret_temp WHERE token= stoken AND codtienda = itienda;
        SELECT 1 result;
    ELSE
    	SELECT 0 result;
    END IF;    
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_insert_nota` (`itienda` INT, `iproveedor` INT, `iusuario` INT, `sfecha` VARCHAR(20))   BEGIN	
    DECLARE inumero int;
    DECLARE icodigo int;
   	SET inumero  = (SELECT ifnull(max(numero),0)numero FROM tb_nota_pedido WHERE codtienda = itienda ORDER BY numero DESC LIMIT 1);    
    SET inumero  = inumero + 1;
    SET icodigo = LAST_INSERT_ID();
    SELECT icodigo codigo;
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_procesar_entrega` (`icodtienda` INT, `inumero` INT, `icodusu` INT, `sfecha` VARCHAR(20))   BEGIN	
	DECLARE registros int;    
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    DECLARE tbl_tmp_pago VARCHAR(20);
    	SET a = 1;
        SET tbl_tmp_pago = CONCAT("tbl_tmp_pago", icodtienda); 
        DROP TABLE IF EXISTS tbl_tmp_pago;
        CREATE TEMPORARY TABLE tbl_tmp_pago(id int not null AUTO_INCREMENT PRIMARY KEY,cod_prod int, cant_prod int);
        SET registros = (SELECT COUNT(*) FROM tb_sale_detail WHERE numero = inumero AND codtnd = icodtienda);
        IF registros > 0 THEN
        	BEGIN
                WHILE a<=registros DO
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto, tmp_cant_producto FROM tbl_tmp_pago WHERE id = a;
                    SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET nueva_existencia = existencia_actual - tmp_cant_producto;
                    UPDATE tb_stock set stock = nueva_existencia WHERE codtienda=icodtienda and codprod=tmp_cod_producto;                    
                    SET a=a+1;
                END WHILE;           
                TRUNCATE TABLE tbl_tmp_pago;
                UPDATE tb_sale SET estado='A' WHERE numero=inumero AND codtnd=icodtienda;                
   				SELECT 1 estado;
            END;
        ELSE
        	BEGIN
            	SELECT 0 estado;
            END;
        END IF; 
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_procesar_pago` (`itiposale` INT, `icodtienda` INT, `inumero` INT, `itipopag` INT, `dmonto` DECIMAL(18,2), `snumopera` VARCHAR(20), `icodusu` INT, `sfecha` VARCHAR(20))   BEGIN	
	DECLARE registros int;    
    DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
    DECLARE tmp_cod_producto int;
    DECLARE tmp_cant_producto int;
    DECLARE a int;
    DECLARE ipago INT;
    DECLARE ptotal DECIMAL(10,2);
    DECLARE ppago DECIMAL(10,2);
    SET a = 1;
    SELECT SUM((precio*cantidad)-ddescu) INTO ptotal FROM tb_sale_detail WHERE numero=inumero AND codtnd=icodtienda;    
            VALUES (icodtienda,inumero,itipopag,dmonto,snumopera,sfecha,icodusu);
	SET ipago = LAST_INSERT_ID();    
    SELECT SUM(montopay) INTO ppago FROM tb_sale_pay WHERE codtienda=icodtienda AND numero=inumero;
    IF ptotal = ppago THEN
    	IF itiposale = 2 THEN        
            DROP TABLE IF EXISTS tbl_tmp_pago;
            CREATE TEMPORARY TABLE tbl_tmp_pago(id int not null AUTO_INCREMENT PRIMARY KEY,cod_prod int, cant_prod int);
            SET registros = (SELECT COUNT(*) FROM tb_sale_detail WHERE numero = inumero AND codtnd = icodtienda);
            IF registros > 0 THEN
                WHILE a<=registros DO
                    SELECT cod_prod,cant_prod INTO tmp_cod_producto, tmp_cant_producto FROM tbl_tmp_pago WHERE id = a;
                    SELECT stock INTO existencia_actual FROM tb_stock WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET nueva_existencia = existencia_actual - tmp_cant_producto;
                    UPDATE tb_stock set stock = nueva_existencia WHERE codtienda=icodtienda and codprod=tmp_cod_producto;
                    SET a=a+1;
                END WHILE;           
                TRUNCATE TABLE tbl_tmp_pago;
            END IF; 
    	END IF;
        UPDATE tb_sale SET estado='A' WHERE numero=inumero AND codtnd=icodtienda;
    END IF;
    SELECT ipago codpago,(ptotal - ppago) saldo;
END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spdw_stock_sale` (`itienda` INT, `iproducto` INT, `icantidad` INT, `iusuario` INT, `sfecha` VARCHAR(20))   BEGIN
	DECLARE nueva_existencia int;
    DECLARE existencia_actual int;
