END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spd_cierre_caja` (IN `itienda` INT, IN `iusuario` INT, IN `icaja` INT, IN `sobserva` TEXT, IN `dsobrante` DECIMAL(8,2), IN `dreserva` DECIMAL(8,2), IN `dsiguiente` DECIMAL(8,2), IN `sfechaclose` VARCHAR(20))   BEGIN		
    DECLARE sfechareg VARCHAR(20);
    DECLARE dinicial DECIMAL(8,2);
    DECLARE defectivo DECIMAL(8,2);
    DECLARE dtotal DECIMAL(8,2);
    DECLARE idetalle INT;       
    SELECT fechareg,inicial INTO sfechareg,dinicial FROM tb_caja WHERE codtnd = itienda AND codcaja = icaja;    
    SELECT SUM(tsp.montopay)INTO defectivo FROM tb_sale_pay tsp INNER JOIN tb_tipo_pago ttp ON tsp.codtipopago=ttp.idpago INNER JOIN tb_sale ts ON (tsp.codtienda=ts.codtnd AND tsp.numero=ts.numero) WHERE tsp.fechapago > sfechareg AND ts.estado != 'X' AND tsp.codusu=iusuario AND tsp.codtienda=itienda AND ttp.idpago=1;    
    SET dtotal = dinicial + defectivo;    
    UPDATE tb_caja SET  fechacierre=sfechaclose, observacion=sobserva, dsobrante=dsobrante, reserva=dreserva, cajasig=dsiguiente, estado = 5 WHERE codcaja = icaja AND codusu = iusuario AND codtnd = itienda;
    SET idetalle = LAST_INSERT_ID();
    SELECT idetalle cerrado;    
END$$

