CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spd_update_producto_adm` (`icodtienda` INT, `icodprod` INT, `istock` INT, `dprecio` DECIMAL(10,2), `sestado` CHAR(1), `cod_usu` INT)   BEGIN
	IF icodprod <> 0 THEN    	
    	UPDATE tb_producto SET estado = sestado WHERE idprod = icodprod;
        UPDATE tb_stock SET stock=istock, sdprecio=dprecio WHERE  codtienda=icodtienda AND codprod = icodprod;
