END$$

CREATE DEFINER=`wwwtortaza`@`localhost` PROCEDURE `spd_verifica_stock_pedido` (`sfecha` VARCHAR(20), `idia` INT, `iproducto` INT)   BEGIN		
    DECLARE icantidad INT;
    DECLARE itotal INT;
  	SELECT IFNULL(SUM(tbpd.cantidad),0)INTO itotal FROM tb_pedido tbp INNER JOIN tb_pedido_detalle tbpd ON (tbp.numero=tbpd.numero AND tbp.codtienda=tbpd.codtienda) WHERE tbp.fecha = sfecha AND tbpd.codproducto=iproducto AND tbp.estado='P';
  	SELECT cantidad INTO icantidad FROM ptb_stock_producto WHERE numdia=idia AND codprod=iproducto;    
    SELECT (icantidad - itotal) AS existe;
END$$

